              link: "/index-it-solution",
              isDark: false
            },
            { id: 13, title: "Business", link: "/index-business" },
            {
              id: 14,
              title: "Modern Business",
              link: "/index-modern-business",
              isDark: false
            },
            {
              id: 15,
              title: "Corporate Business",
              link: "/index-corporate",
              isDark: false
            },
            { id: 16, title: "Hotel", link: "/index-hotel" },
            {
              id: 17,
